int fib(int n) {
    if (n < 2) {
        return n;
    }
    int a = 0;
    int b = 1;
    int i = 1;
    while (i < n) {
        int t = a + b;
        a = b;
        b = t;
        i = i + 1;
    }
    return b;
}

